import AdminHeader from "../components/AdminHeader";
import axios from 'axios';
import { useState } from "react";
import { useNavigate } from 'react-router-dom';
const UserAssessment=()=>{
    const token=sessionStorage.getItem("token")
    const navigate=useNavigate();
    const [assess,setAssess]=useState([

        {
          aiQuizId:1,
          countSolveTimes:135,
         countNotRecommendTimes:117
        },
        {
            aiQuizId:2,
            countSolveTimes:85,
           countNotRecommendTimes:11
          },
          {
            aiQuizId:3,
            countSolveTimes:35,
           countNotRecommendTimes:7
          },
        
      ]);
return(
    <div className="AdminEntire">
        <AdminHeader/>
        <div className="UserText">사용자 평가 조회</div>
        <div>
            <div>ID</div><div>풀이횟수</div><div>비추천 개수</div><div>비추천 비율</div></div>
           {assess&&assess.map((it)=>{
            return(
                <div>
            <div>{it.aiQuizId}</div><div>{it.countSolveTimes}</div><div>{it.countNotRecommendTimes}</div>
            <div>{it.aiQuizId/it.countNotRecommendTimes}</div></div>)
           })}
    </div>
)
};  
export default UserAssessment;
